    case DivisionByZero = 2
    case NotSupported = 3
record Domain.OpError.General
    field p1 string = 1
record Domain.OpError.DivisionByZero
record Domain.OpError.NotSupported
message Domain.OpError.General
    field p1 string = 1
message Domain.OpError.DivisionByZero
message Domain.OpError.NotSupported
union Domain.OpResult
    case Success = 1
    case Fail = 2
